import React, { useState, useEffect } from "react";

import Prodreefer from "../components/Prodreefer.jsx";

const images = [
  "/attachment/pic1.jpg",
  "/attachment/pic2.jpg",
  "/attachment/pic3.jpg",
  "/attachment/pic4.jpg",
];

export default function Products() {
  const [currentIndex, setCurrentIndex] = useState(0);

  // Auto loop every 3 seconds
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentIndex((prev) => (prev + 1) % images.length);
    }, 3000);

    return () => clearInterval(interval);
  }, []);

  // Manual navigation
  const goPrev = () => {
    setCurrentIndex((prev) => (prev === 0 ? images.length - 1 : prev - 1));
  };

  const goNext = () => {
    setCurrentIndex((prev) => (prev + 1) % images.length);
  };

  return (
    <>

      <div className="flex mx-auto w-full items-center justify-center p-4">
        <h1 className="text-4xl font-bold text-indigo-600 uppercase tracking-wide">
          Product
        </h1>
      </div>

      <div className="flex flex-col md:flex-row items-center bg-white rounded-md w-full overflow-hidden m">
        <div className="flex flex-col md:flex-row w-full ">
          <div className="md:w-1/2 w-full">
            <div className="clip-custom-shape flex flex-col items-center justify-center -ml-[70px] right-1">
              <img
                src="/attachment/Reefer.png"
                // alt={`Slide ${currentIndex + 1}`}
                alt=""
                className="object-cover md:w-full h-full"
              />
            </div>
          </div>
          <div className="md:w-1/2 w-full">
            <div className="w-full flex flex-col mx-auto items-center">
              <h1 className="text-2xl font-bold text-indigo-600 uppercase tracking-wide">
                Reefer system
              </h1>
            </div>
            <div className="flex flex-col md:flex-row w-full">
              <div className="w-full md:w-1/2 flex flex-col mx-auto items-center">
                <div className="md:w-1/2 w-full">
                  <div className="clip-custom-shape flex flex-col items-center justify-center -ml-[70px] right-1">
                    <img
                      src="/attachment/Reefer.png"
                      // alt={`Slide ${currentIndex + 1}`}
                      alt=""
                      className="object-cover md:w-full h-full"
                    />
                  </div>
                </div>
              </div>
              <div className="w-full md:w-1/2 flex mx-auto items-center">
                <h1 className="text-2xl font-bold text-indigo-600 uppercase tracking-wide">
                  - Reefer Box
                </h1>
              </div>
            </div>
            <div className="flex flex-col md:flex-row w-full">
              <div className="w-full md:w-1/2 flex flex-col mx-auto items-center">
                <div className="md:w-1/2 w-full">
                  <div className="clip-custom-shape flex flex-col items-center justify-center -ml-[70px] right-1">
                    <img
                      src="/attachment/Reefer.png"
                      // alt={`Slide ${currentIndex + 1}`}
                      alt=""
                      className="object-cover md:w-full h-full"
                    />
                  </div>
                </div>
              </div>
              <div className="w-full md:w-1/2 flex mx-auto items-center">
                <h1 className="text-2xl font-bold text-indigo-600 uppercase tracking-wide">
                  - Reefer Box
                </h1>
                <h3 className="text-2xl font-bold text-indigo-600 uppercase tracking-wide">
                  Box maliit.malaki
                </h3>
              </div>
            </div>
            <div className="flex flex-col md:flex-row w-full">
              <div className="w-full md:w-1/2 flex flex-col mx-auto items-center">
                <div className="md:w-1/2 w-full">
                  <div className="clip-custom-shape flex flex-col items-center justify-center -ml-[70px] right-1">
                    <img
                      src="/attachment/Reefer.png"
                      // alt={`Slide ${currentIndex + 1}`}
                      alt=""
                      className="object-cover md:w-full h-full"
                    />
                  </div>
                </div>
              </div>
              <div className="w-full md:w-1/2 flex mx-auto items-center">
                <h1 className="text-2xl font-bold text-indigo-600 uppercase tracking-wide">
                  - Reefer Box
                </h1>
              </div>
            </div>
          </div>
          <div className="absolute -bottom-1 left-1/2 transform -translate-x-1/2 flex space-x-2 p-2">
            {images.map((_, idx) => (
              <button
                key={idx}
                onClick={() => setCurrentIndex(idx)}
                className={`w-3 h-3 rounded-full ${idx === currentIndex ? "bg-blue-600" : "bg-gray-300"
                  }`}
              />
            ))}
          </div>
        </div>
      </div>
      <div>
        <button>
          See more Product!
        </button>
      </div>
    </>
  );
}
